export function moduleData(){return{props:{returnData:Function,value:[String,Object],args:Object},data:function(){return{option:this.value}},watch:{option:{handler(t,e){this.returnData(t)},deep:!0},value:{handler(t,e){this.option=this.value},deep:!0}},methods:{logChange(){this.returnData(this.option)}},template:'\n    <div class="uip-flex uip-w-100p">\n      <select @change="logChange()" class="uip-input-small uip-padding-top-xxxs uip-padding-bottom-xxxs uip-max-w-100p uip-w-100p" \n      style="padding-top:2px;padding-bottom:2px;border-radius:var(--uip-border-radius-large);" v-model="option">\n        <template v-for="item in args.options">\n          <option :value="item.value">{{item.label}}</option>\n        </template>\n      </select>\n    </div>'}};